import React from "react";

const DodavanjeArtikla=()=>{

    const [formData, setFormData]=useState({
        "prodavacId": 4, //zakucala na prodavac2
        "naziv": "string",
        "cena": 0,
        "kolicina": 0,
        "opis": "string",
        "slika": "string"
    });

    const handleChange=(e)=>{
        const {name, value} = e.target;
        setFormData({
            ...formData,
            [name]: value,
        });
    };

    return(
        <div>
            <p>Dodavanje artikla</p>
            <form onSubmit={handleSubmit} ref={formRef}>
                <label>
                    Naziv:
                    <input
                        type="text"
                        name="naziv"
                        onChange={handleChange}
                    />
                    <p></p>
                </label>
                <label>
                    Cena:
                    <input
                        type="number"
                        name="cena"
                        onChange={handleChange}
                    />
                    <p></p>
                </label>
                <label>
                    Kolicina:
                    <input
                        type="number"
                        name="kolicina"
                        onChange={handleChange}
                    />
                    <p></p>
                </label>
                <label>
                    Opis:
                    <input
                        type="text"
                        name="opis"
                        onChange={handleChange}
                    />
                    <p></p>
                </label>
                <label>
                    Slika:
                    <input
                        type="text"
                        name="slika"
                        onChange={handleChange}
                    />
                    <p></p>
                </label>
                
            </form>
        </div>
    );
};

export default DodavanjeArtikla;
